def seek(stream, distinct_chars):
    marker = []
    marker_i = 0
    for i in range(0, len(stream)):
        marker_i += 1
        c = stream[i]
        if c in marker:
            marker = marker[marker.index(c) + 1:]
        marker.append(c)
        if len(marker) == distinct_chars:
            break
    return marker_i


def solve(puzzle_input):
    stream = puzzle_input[1:-1]
    i = seek(stream, 4)
    print(i)
    print(seek(stream, 14))
    return


